import React, {Component} from 'react';

class BottomNavigation extends Component {
    render() {
        return (
            <div className="bottomnavigation">
                <ul>
                    <li><i className="fas fa-bars fa-2x"></i></li>
                    <li>All Shope</li>
                    <li>Gift Card</li>
                    <li>Campaigns</li>
                    <li>Friends Deal</li>
                    <li>Prime Deal</li>
                    <li>News Feed</li>
                    <li>Marchent zone</li>
                    <li>Help</li>

                </ul>
            </div>
        );
    }
}

export default BottomNavigation;
